window.bookSummaryJSON = "<p><b>All I wanted to do was sit back and relax with a certain hot—very, very hot, panty-melting hot—wereape. But, instead, I'm busy trying to find the queen of hell. </b></p> <p>Have I found her? Not yet. And I'm running out of places to look. I know it's only a matter of time before she does something stupid—like obliterate an entire town because they dressed better than her because that's who she is. </p> <p>But I've got worse problems. </p> <p>Things soon spiral down the crapper when two teenagers are found dead in Hollow Cove. The evidence points to something witchy. </p> <p>A new evil hangs over our town, a significant threat to the Davenport witches and all the witches in Hollow Cove. I must defeat this new threat to keep my loved ones safe.</p> <p>Easy peasy, right?</p> <p>We'll see.</p>"; 
